import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import "./";
import "../../Assets/css/sb-admin-2.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js";
import { Link,useNavigate } from 'react-router-dom';
import Cookies from 'js-cookie';
import axios from 'axios';
import Swal from 'sweetalert2'; 



const Sidebar = () => {
    const navigate = useNavigate(); // Initialize the navigate function

    const [loading, setLoading] = useState(false);
  const [successMessage, setSuccessMessage] = useState('');

    const handleLogout = () => {
        console.log('Logout button clicked'); // Add this log to check if the button is clicked
        Cookies.remove('userToken');
        console.log('User token removed'); // Add this log to check if the user token is removed
        navigate("/"); // Use navigate to go to the desired route
        console.log('Navigate to root');
    };


    const handleCreateRole = async () => {
        try {
          // Retrieve the JWT token from Cookies
          const userToken = Cookies.get('userToken');

          if (!userToken) {
            // Handle the case when the token is not available
            console.error('JWT Token is not available');
            return;
          }

          // Include the token in the request headers
          const headers = {
            Authorization: `Bearer ${userToken}`,
          };

          setLoading(true);

          // Make the API request using axios to create a role
          await axios.get('/role/create/current_role/ADMIN', { headers });

          navigate('/role-creation'); 
          Swal.fire({
            icon: 'success',
            title: 'Role Created!',
            text: 'The role has been created successfully.',
            confirmButtonColor: '#3085d6',
            confirmButtonText: 'OK',
          });

        } catch (error) {
          console.error('Error creating role:', error);
        } finally {
          setLoading(false);
        }
    };

    const handleCreateAdministration = async () => {
        try {
          // Retrieve the JWT token from Cookies
          const userToken = Cookies.get('userToken');

          if (!userToken) {
            // Handle the case when the token is not available
            console.error('JWT Token is not available');
            return;
          }

          // Include the token in the request headers
          const headers = {
            Authorization: `Bearer ${userToken}`,
          };

          setLoading(true);

          // Make the API request using axios to create a role
          await axios.get('/administration/create/current_role/ADMIN', { headers });

          navigate('/crate-administration'); 
          Swal.fire({
            icon: 'success',
            title: 'Administration Created!',
            text: 'The Administration has been created successfully.',
            confirmButtonColor: '#3085d6',
            confirmButtonText: 'OK',
          });

        } catch (error) {
          console.error('Error creating role:', error);
        } finally {
          setLoading(false);
        }
    };


    return ( 

        <ul className="navbar-nav bg-gradient-primary sidebar sidebar-dark accordion" id="accordionSidebar">
            <a className="sidebar-brand d-flex align-items-center justify-content-center" href="/admin_dashboard">
                {/* <div className="sidebar-brand-icon ">
                    <i className="fas fa-house"></i>
                </div> */}
                <div className="sidebar-brand-text mx-3"></div>
            </a>
            <hr className="sidebar-divider my-0" />
            <li className="nav-item">
                <a className="nav-link" href="/admin-dashboard">
                    <i className="fas fa-fw fa-tachometer-alt"></i>
                    <span>Dashboard</span>
                </a>
            </li>
            <hr className="sidebar-divider" />
            <div className="sidebar-heading">Actions</div>
            <li className="nav-item">
                <a className="nav-link collapsed d-flex align-items-center justify-content-between" href="#collapseTwo"
                    data-bs-toggle="collapse" data-bs-target="#collapseTwo" aria-expanded="true"
                    aria-controls="collapseTwo">
                    <span>
                        <i className="fas fa-th-list"></i>
                        Orginzation
                    </span>
                    <i className="fas fa-angle-right"></i>
                </a>
                <div id="collapseTwo" className="collapse" aria-labelledby="headingTwo" data-parent="#accordionSidebar">
                    <div className="bg-white py-2 collapse-inner rounded">
                        <a className="collapse-item" href="/organization-details"><i className="fas fa-plus-circle"></i> View</a>
                        <a className="collapse-item" href="/organization-details-update"><i class="far fa-edit"></i>Update</a>
                        <a className="collapse-item" href="/organization-delete"><i class="fas fa-trash"></i> Delete</a>

                    </div>
                </div>
            </li>
            <li className="nav-item">
                <a className="nav-link collapsed d-flex align-items-center justify-content-between" href="#collapseUtilities"
                    data-bs-toggle="collapse" data-bs-target="#collapseUtilities" aria-expanded="true"
                    aria-controls="collapseUtilities">
                    <span>
                        <i className="fas fa-solid fa-hotel"></i>
                        Role
                    </span>
                    <i className="fas fa-angle-right"></i>
                </a>
                <div id="collapseUtilities" className="collapse" aria-labelledby="headingUtilities"
                    data-parent="#accordionSidebar">
                    <div className="bg-white py-2 collapse-inner rounded">
                    <a className="collapse-item" href="#" onClick={handleCreateRole}>
              <i className="fas fa-plus-circle"></i> Create</a>                        
                        <a className="collapse-item" href="/user-role"><i class="fas fa-user"></i> View</a>

                    </div>
                </div>
            </li>
            <li className="nav-item">
                <a className="nav-link collapsed d-flex align-items-center justify-content-between" href="#collapseUsers"
                    data-bs-toggle="collapse" data-bs-target="#collapseUsers" aria-expanded="true"
                    aria-controls="collapseUsers">
                    <span>
                        <i className="fas fa-solid fa-user"></i>
                        User
                    </span>
                    <i className="fas fa-angle-right"></i>
                </a>
                <div id="collapseUsers" className="collapse" aria-labelledby="headingUsers"
                    data-parent="#accordionSidebar">
                    <div className="bg-white py-2 collapse-inner rounded">

                        <a className="collapse-item" href="/user-create"><i className="fas fa-plus-circle"></i> Create</a>
                        <a className="collapse-item" href="/user-details"><i className="fas fa-newspaper"></i> View</a>
                        {/* <a className="collapse-item" href="/user-details-similar"><i className="fas fa-newspaper"></i>View Similar</a> */}
                        <a className="collapse-item" href="/user-details-update"><i class="fas fa-sync-alt"></i> Update</a>
                        <a className="collapse-item" href="/change-password"><i class="fas fa-edit"></i> Change password</a>
                        <a className="collapse-item" href="/change-default-role"><i class="fas fa-exchange-alt"></i> Change default role</a>
                        <a className="collapse-item" href="/delete-user"><i class="fas fa-user-times"></i> Delete user</a>

                    </div>
                </div>
            </li>
            <li className="nav-item">
                <a className="nav-link collapsed d-flex align-items-center justify-content-between" href="#userRole"
                    data-bs-toggle="collapse" data-bs-target="#userRole" aria-expanded="true"
                    aria-controls="userRole">
                    <span>
                        <i className="fas fa-solid fa-hotel"></i>
                       User Role
                    </span>
                    <i className="fas fa-angle-right"></i>
                </a>
                <div id="userRole" className="collapse" aria-labelledby="headingUtilities"
                    data-parent="#accordionSidebar">
                    <div className="bg-white py-2 collapse-inner rounded">
                        <a className="collapse-item" href="/create-user-role"><i className="fas fa-plus-circle"></i> Create</a>                        
                        <a className="collapse-item" href="/view-user-role"><i class="fab fa-readme"></i> Read</a>
                        <a className="collapse-item" href="/view-all-roles"><i class="fas fa-book-reader"></i> Read All</a>
                        <a className="collapse-item" href="/delete-user-role"><i class="fas fa-trash-alt"></i> Delete</a>
                    </div>
                </div>
            </li>

            <li className="nav-item">
                <a className="nav-link collapsed d-flex align-items-center justify-content-between" href="#administration"
                    data-bs-toggle="collapse" data-bs-target="#administration" aria-expanded="true"
                    aria-controls="userRole">
                    <span>
                        <i className="fas fa-solid fa-hotel"></i>
                       Administration
                    </span>
                    <i className="fas fa-angle-right"></i>
                </a>
                <div id="administration" className="collapse" aria-labelledby="headingUtilities"
                    data-parent="#accordionSidebar">
                    <div className="bg-white py-2 collapse-inner rounded">
                    <a className="collapse-item" href="#" onClick={handleCreateAdministration}>
              <i className="fas fa-plus-circle"></i> Create</a>                      
                        <a className="collapse-item" href="/view-administration"><i class="fab fa-readme"></i> View</a>
                        <a className="collapse-item" href="/allocate-deallocate"><i class="fas fa-book-reader"></i> Allocate-Deallocate</a>
                        <a className="collapse-item" href="/list-administration"><i class="fas fa-trash-alt"></i> List</a>
                        <a className="collapse-item" href="/list-all-administration"><i class="fas fa-trash-alt"></i> List-All</a>
                    </div>
                </div>
            </li>


            <li className="nav-item">
                <a className="nav-link collapsed d-flex align-items-center justify-content-between" href="#team"
                    data-bs-toggle="collapse" data-bs-target="#team" aria-expanded="true"
                    aria-controls="userRole">
                    <span>
                        <i className="fas fa-solid fa-hotel"></i>
                       Team
                    </span>
                    <i className="fas fa-angle-right"></i>
                </a>
                <div id="team" className="collapse" aria-labelledby="headingUtilities"
                    data-parent="#accordionSidebar">
                    <div className="bg-white py-2 collapse-inner rounded">
                        <a className="collapse-item" href="/create-team"><i className="fas fa-plus-circle"></i> Create</a>                      
                        <a className="collapse-item" href="/view-team"><i class="fab fa-readme"></i> View</a>
                        <a className="collapse-item" href="/view-all-teams"><i class="fas fa-book-reader"></i>View All</a>
                        <a className="collapse-item" href="/view-my-teams"><i class="fas fa-trash-alt"></i>View My</a>
                        <a className="collapse-item" href="/update-team"><i class="fas fa-trash-alt"></i> Update </a>
                        <a className="collapse-item" href="/delete-team"><i class="fas fa-trash-alt"></i> Delete </a>
                        <a className="collapse-item" href="/create-member"><i class="fas fa-trash-alt"></i> Create Member </a>
                        <a className="collapse-item" href="/view-member"><i class="fas fa-trash-alt"></i> View Member </a>
                        <a className="collapse-item" href="/view-members"><i class="fas fa-trash-alt"></i> View Members </a>
                        <a className="collapse-item" href="/update-member"><i class="fas fa-trash-alt"></i> Update Member</a>


                    </div>
                </div>
            </li>

            <hr className="sidebar-divider" />
            {/* <div className="sidebar-heading">Views</div>

            <li className="nav-item">
                <a className="nav-link" href="/view_complaint"> <i className="fas fa-fw fa-comments"></i> <span>Complaints</span> </a>
            </li>
            <li className="nav-item">
                <a className="nav-link" href="/view_maintenance"> <i className="fas fa-fw fa-wrench"></i> <span>Maintenance</span> </a>
            </li>
            <li className="nav-item">
                <a className="nav-link" href="/user_log"> <i className="fas fa-list "></i> <span>User Log</span> </a>
            </li>
            <hr className="sidebar-divider d-none d-md-block" />
            <div className="text-center d-none d-md-inline">
            </div>
            <hr className="sidebar-divider d-none d-md-block" /> */}

            <div className="text-center d-none d-md-inline">
            <div className="text-center d-none d-md-inline">
            {/* <button onClick={handleLogout} className="btn btn-link" style={{ cursor: 'pointer' }}>
                <i className="fas fa-fw fa-sign-out-alt"></i>
                <span>Logout</span>
            </button> */}
        </div>
      </div>
      {successMessage && (
        <div className="alert alert-success mt-3 text-center" role="alert" style={{ position: 'fixed', top: '50%', left: '50%', transform: 'translate(-50%, -50%)' }}>
          {successMessage}
        </div>
      )}
        </ul>


    );
};

export default Sidebar;
